webpackJsonp([322],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-improve-existing-pull-request-by-another-contributor.json":function(e,o){e.exports={data:{markdownRemark:{html:"<p>How to take someone's PR and make your own based off it while keeping their commit:</p>\n<ol>\n<li>Make a new branch, preferibly with the PR# of the original one.</li>\n</ol>\n<p><code>git checkout -b pr/xyz</code></p>\n<ol>\n<li>Pull the changes to it.</li>\n</ol>\n<p><code>git pull git://github.com/rafase282/wiki.git update/pr-guide</code></p>\n<p>This basically means pull from the repository <strong>Rafase282/wiki</strong>, branch <strong>update/pr/guide</strong> into your current branch <strong>pr/xyz</strong>.</p>\n<ol>\n<li>Make your changes, add, commit, push. If you need to squash make sure to keep the original contributor's commit untouched.</li>\n</ol>\n<p><strong>Note</strong>: You might need to force push <code>git push -f origin pr/xyz</code></p>\n<ol>\n<li>Create your PR and in the description make it to close the original PR with <code>closes #xyz</code></li>\n</ol>\n<p>That should make a new pull request with the original changes, plus your own into a new pull request that will automatically reference and close the original one when merged.</p>",frontmatter:{title:"Improve Existing Pull Request by Another Contributor",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/improve-existing-pull-request-by-another-contributor/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/improve-existing-pull-request-by-another-contributor/"}}}});
